def predict(make,model,vehicle_class,engine_size,cylinders,transmission,fuel_type,fuel_city,fuel_highway,fuel_comb,fuel_comb_mpg):
    selected_make = make_dict[make]
    selected_model = model_dict[model]
    selected_vehicle_class = vehicle_class_dict[vehicle_class]
    selected_transmission = transmission_dict[transmission]
    selected_fuel_type = fuel_type_dict[fuel_type]
    input_data = np.array([[selected_make,selected_model,selected_vehicle_class,engine_size,cylinders,selected_transmission,selected_fuel_type,fuel_city,fuel_highway,fuel_comb,fuel_comb_mpg]])
    return reg.predict(input_data)[0]


